INSERT INTO `stories` (`id`, `language_code`, `title`, `content`, `is_used`, `used_date`, `created_at`) VALUES
(10, 'tr_TR', 'Ayşe Hanım\'ın Uykuyla Barışması', 'Ayşe Hanım emekli bir öğretmendi.  Uzun yıllar boyunca yoğun tempoda çalışmış, uykusuz gecelere alışmıştı. Emekliliğiyle birlikte rahatlayacağını düşünmüştü ama olmadı. Geçmişin alışkanlıkları peşini bırakmamış, uykusuzluk sorunu devam etmişti. Geceleri sayısız koyun sayar, sabahları yorgun ve bitkin uyanırdı. Bir gün parkta yürüyüş yaparken, aynı dertten muzdarip  Fatma Hanım\'la tanıştı. Fatma Hanım, bir uyku uzmanına gittiğinden ve hayatının nasıl değiştiğinden bahsetti. Ayşe Hanım başta tereddüt etse de, Fatma Hanım\'ın anlattıkları onu ikna etti. Uzman, Ayşe Hanım\'a düzenli bir uyku programı oluşturmasını, yatmadan önce rahatlatıcı aktiviteler yapmasını ve kafein tüketimini azaltmasını önerdi. Ayşe Hanım, bu önerileri uygulamaya başladı. İlk başta zorlansa da, zamanla vücudu yeni düzene alıştı.  Artık geceleri deliksiz uyuyor, sabahları dinç ve enerjik uyanıyordu. Uykuyla barışmış, hayatın tadını yeniden çıkarmaya başlamıştı.', 0, NULL, '2024-11-19 11:54:03'),
(11, 'en', 'Finding Rest: Mary\'s Journey to Peaceful Sleep', 'Mary, a retired teacher, had grown accustomed to sleepless nights during her demanding career. She expected retirement to bring tranquility, but her sleep problems persisted.  She’d count countless sheep, only to wake up exhausted each morning. One day, during her walk in the park, she met Elizabeth, who shared a similar struggle. Elizabeth recounted her experience with a sleep specialist and how it had transformed her life.  Initially hesitant, Mary was eventually persuaded. The specialist advised her to establish a regular sleep schedule, engage in relaxing activities before bed, and reduce caffeine intake.  Mary diligently followed these recommendations. Though challenging at first, her body gradually adapted.  She now slept soundly through the night, waking up refreshed and energized.  Having finally found peace with sleep, Mary rediscovered the joy in her life.', 1, '2024-12-05', '2024-11-19 11:54:03'),
(12, 'ru', 'Возвращение сна: История Анны', 'Анна, учительница на пенсии, привыкла к бессонным ночам во время своей напряженной карьеры. Она ожидала, что выход на пенсию принесет спокойствие, но проблемы со сном остались. Она считала бесчисленных овец, только чтобы каждое утро просыпаться измученной. Однажды, гуляя в парке, она познакомилась с Еленой, которая столкнулась с той же проблемой. Елена рассказала о своем опыте обращения к специалисту по сну и о том, как это изменило ее жизнь.  Поначалив, Анна все же решилась. Специалист посоветовал ей установить регулярный режим сна, заниматься расслабляющими занятиями перед сном и уменьшить потребление кофеина. Анна старательно следовала этим рекомендациям. Хотя поначалу было трудно, ее организм постепенно адаптировался.  Теперь она крепко спит всю ночь, просыпаясь отдохнувшей и полной энергии.  Наконец-то обретя покой во сне, Анна заново открыла для себя радость жизни.', 1, '2024-11-19', '2024-11-19 11:54:03'),
(13, 'zh', '重拾安眠：王阿姨的睡眠之旅', '王阿姨是一位退休教师，在 demanding career 期间，她已经习惯了不眠之夜。她期待退休能带来宁静，但她的睡眠问题依然存在。她会数着无数的绵羊，却每天早上醒来都筋疲力尽。有一天，她在公园散步时遇到了李阿姨，她也面临着同样的困境。李阿姨讲述了她去看睡眠专家的经历，以及这段经历如何改变了她的生活。起初犹豫不决的王阿姨最终被说服了。专家建议她建立规律的睡眠时间表，睡前进行放松活动，并减少咖啡因的摄入量。王阿姨 diligently followed 这些建议。虽然一开始很困难，但她的身体逐渐适应了。现在她整夜睡得很香，醒来时精神焕发，充满活力。终于重新找回了睡眠的平静，王阿姨重新发现了生活的乐趣。', 1, '2024-11-19', '2024-11-19 11:54:03'),
(14, 'tr_TR', 'Sessizliğin Tadını Keşfetmek: Ayşe\'nin Dijital Detoksu', 'Ayşe, emekli bir öğretmendi. Günlerini çoğunlukla sosyal medyada gezinerek geçiriyordu. Haberler, arkadaşlarının paylaşımları, tanımadığı insanların hayatları… Hepsi Ayşe\'nin zihnini dolduruyor, onu gerçek hayattan koparıyordu. Bir gün torunu Zeynep, Ayşe’ye sordu: \"Anneanne, neden hep telefonla ilgileniyorsun? Benimle oyun oynayalım.\" Zeynep’in bu sorusu Ayşe’yi derinden etkiledi. O akşam, telefonu sessize aldı ve bir kenara bıraktı. İlk başta zorlandı. Sürekli telefonu kontrol etme isteği duydu. Ama direnmeye kararlıydı. Ertesi gün, balkonda çiçeklerini suladı. Uzun zamandır ihmal ettiği kitaplarını okumaya başladı. Komşusuyla sohbet etti, parka yürüyüşe çıktı. Günler geçtikçe, Ayşe sosyal medyanın yarattığı boşluğun farkına vardı. Kendini daha huzurlu, daha mutlu hissediyordu. Artık gerçek hayatta, gerçek insanlarla bağ kuruyordu. Sosyal medyayı tamamen bırakmadı ama kullanımını sınırladı. Artık hayatının kontrolü elindeydi. Sessizliğin tadını, gerçek hayatın güzelliklerini yeniden keşfetmişti.', 1, '2024-12-04', '2024-11-19 11:56:38'),
(15, 'en', 'Discovering the Quiet: Elizabeth\'s Digital Detox', 'Elizabeth, a retired teacher, spent most of her days scrolling through social media. News, friends\' posts, the lives of strangers… It all filled Elizabeth\'s mind, disconnecting her from real life. One day, her granddaughter, Sarah, asked: \"Grandma, why are you always on your phone? Let\'s play a game.\" Sarah\'s question deeply affected Elizabeth. That evening, she silenced her phone and put it aside. It was difficult at first. She constantly felt the urge to check her phone. But she was determined to resist. The next day, she watered her flowers on the balcony. She started reading the books she had neglected for a long time. She chatted with her neighbor and went for a walk in the park. As the days passed, Elizabeth realized the emptiness created by social media. She felt more peaceful, happier. She was now connecting with real people in real life. She didn\'t quit social media entirely, but limited its use. Now she was in control of her life. She had rediscovered the taste of silence, the beauty of real life.', 1, '2024-11-19', '2024-11-19 11:56:38'),
(16, 'ru', 'Открывая тишину: цифровой детокс Елены', 'Елена, учительница на пенсии, проводила большую часть своих дней в социальных сетях. Новости, посты друзей, жизнь незнакомых людей… Всё это заполняло мысли Елены, отрывая её от реальной жизни. Однажды её внучка, Аня, спросила: «Бабушка, почему ты всё время в телефоне? Давай поиграем».  Вопрос Ани глубоко затронул Елену. В тот вечер она отключила звук на телефоне и отложила его в сторону. Сначала было трудно.  Она постоянно испытывала желание проверить телефон. Но она решила сопротивляться. На следующий день она полила цветы на балконе.  Она начала читать книги, которые давно забросила.  Она пообщалась с соседкой и прогулялась в парке.  Шли дни, и Елена осознала пустоту, создаваемую социальными сетями. Она чувствовала себя спокойнее, счастливее.  Теперь она общалась с реальными людьми в реальной жизни. Она не отказалась от социальных сетей полностью, но ограничила их использование. Теперь она контролировала свою жизнь.  Она заново открыла для себя вкус тишины, красоту реальной жизни.', 0, NULL, '2024-11-19 11:56:38'),
(17, 'zh', '发现宁静：丽丽的数字排毒', '丽丽是一位退休教师，她大部分时间都花在浏览社交媒体上。新闻、朋友的帖子、陌生人的生活……这一切充斥着丽丽的思绪，让她与现实生活脱节。有一天，她的孙女小雅问她：“奶奶，你为什么总是玩手机？我们一起玩游戏吧。” 小雅的问题深深地触动了丽丽。那天晚上，她把手机调成静音，放在了一边。一开始很难受，她一直想查看手机。但她决心坚持下去。第二天，她在阳台上浇花。她开始读她搁置已久的书。她和邻居聊天，去公园散步。日子一天天过去，丽丽意识到了社交媒体带来的空虚。她感到更加平静，更加快乐。她现在在现实生活中与真人建立联系。她没有完全放弃社交媒体，而是限制了它的使用。现在，她掌控着自己的生活。她重新发现了宁静的滋味，重新发现了现实生活的美好。', 0, NULL, '2024-11-19 11:56:38'),
(18, 'tr_TR', 'Sessizliğin Melodi̇si̇', 'Demir, yıllarca alkolün bulanık perdesinin ardında yaşamıştı. Hayatının kontrolünü eline almak, gerçek benliğini bulmak için verdiği mücadele, onu defalarca yıkmıştı. Her sabah aynı pişmanlıkla uyanıyor, her akşam aynı karanlığa gömülüyordu. Ta ki bir gün, parkta çalan bir keman melodisi onu kendine getirene kadar.  Müzik, Demir\'in içine işleyerek yıllardır hissetmediği bir duyguyu uyandırdı: umut. O gün, Demir bir karar aldı. Alkolü bırakıp hayatının melodisini yeniden yazacaktı. Bu kolay olmadı. Çekilme semptomları, sosyal baskı ve derinlerde yatan korkuları, Demir\'in kararlılığını sınadı.  Ama Demir, pes etmedi.  Destek gruplarına katıldı, terapiste gitti ve en önemlisi, kendisine inandı.  Zamanla, alkolün sisleri dağıldı ve Demir, uzun zamandır unuttuğu renkleri görmeye başladı.  Resim yapmaya başladı,  keman dersleri aldı ve  yeni insanlarla tanıştı. Hayat, ona yeni kapılar açıyordu. Demir, artık sessizliğin melodisini duyabiliyordu. Bu melodi, onun kendi iç sesiydi, onu güçlü ve özgür kılan bir ses.  Demir\'in hikayesi,  değişimin mümkün olduğunu, umudun her zaman var olduğunu ve  hayatın,  yaşanmaya değer bir melodi olduğunu hatırlatıyor.', 0, NULL, '2024-11-19 12:25:10'),
(19, 'en', 'The Melody of Silence', 'Demir had lived for years behind the blurry curtain of alcohol. His struggle to regain control of his life, to find his true self, had broken him repeatedly. Every morning he woke up with the same regret, every evening he sank into the same darkness. Until one day, a violin melody playing in the park brought him to his senses. The music penetrated Demir, awakening a feeling he hadn\'t felt in years: hope. That day, Demir made a decision. He would quit drinking and rewrite the melody of his life. It wasn\'t easy. Withdrawal symptoms, social pressure, and deep-seated fears tested Demir\'s resolve. But Demir didn\'t give up. He attended support groups, saw a therapist, and most importantly, believed in himself. Over time, the fog of alcohol lifted, and Demir began to see colors he had long forgotten. He started painting, took violin lessons, and met new people. Life was opening new doors for him. Demir could now hear the melody of silence. This melody was his own inner voice, a voice that made him strong and free. Demir\'s story reminds us that change is possible, hope is always present, and life is a melody worth living.', 1, '2024-11-28', '2024-11-19 12:25:10'),
(20, 'ru', 'Мелодия Тишины', 'Демир годами жил за размытой завесой алкоголя. Его борьба за то, чтобы вернуть контроль над своей жизнью, найти свое истинное «я», многократно ломала его. Каждое утро он просыпался с одним и тем же сожалением, каждый вечер погружался в ту же тьму. Пока однажды мелодия скрипки, играющая в парке, не привела его в чувство. Музыка проникла в Демира, пробудив чувство, которое он не испытывал годами: надежду. В тот день Демир принял решение. Он бросит пить и перепишет мелодию своей жизни. Это было непросто. Симптомы отмены, социальное давление и глубоко укоренившиеся страхи проверяли решимость Демира. Но Демир не сдавался. Он посещал группы поддержки, ходил к терапевту и, самое главное, верил в себя. Со временем туман алкоголя рассеялся, и Демир начал видеть цвета, которые он давно забыл. Он начал рисовать, брать уроки игры на скрипке и знакомиться с новыми людьми. Жизнь открывала ему новые двери. Теперь Демир мог слышать мелодию тишины. Эта мелодия была его собственным внутренним голосом, голосом, который делал его сильным и свободным. История Демира напоминает нам, что перемены возможны, надежда всегда присутствует, а жизнь — это мелодия, которую стоит прожить.', 0, NULL, '2024-11-19 12:25:10'),
(21, 'zh', '寂静的旋律', '多年来，德米尔一直生活在酒精的迷雾之中。他努力想要重新掌控自己的人生，找回真正的自我，却一次又一次地失败。每天早晨，他都在悔恨中醒来，每个夜晚，他都沉沦于同样的黑暗。直到有一天，公园里响起的小提琴旋律将他唤醒。音乐穿透了德米尔的心灵，唤醒了他多年来不曾感受到的情感：希望。那天，德米尔做出了一个决定。他要戒酒，重新谱写人生的旋律。这并不容易。戒断反应、社会压力和深藏的恐惧考验着德米尔的决心。但德米尔没有放弃。他参加互助小组，去看心理医生，最重要的是，他相信自己。渐渐地，酒精的迷雾散去，德米尔开始看到他早已遗忘的色彩。他开始画画，学习小提琴，结识新朋友。生活为他打开了新的 doors。现在，德米尔可以听到寂静的旋律。这旋律是他内心的声音，一个让他变得强大和自由的声音。德米尔的故事提醒我们，改变是可能的，希望始终存在，而人生是一曲值得聆听的旋律。', 0, NULL, '2024-11-19 12:25:10'),
(22, 'tr_TR', 'Çatlak Bardak', 'El yapımı seramik bir bardak olan Elif, kusurluydu. Yan tarafında ince bir çatlak vardı. Diğer bardaklar gibi mükemmel değildi, bu yüzden rafta arkada dururdu. Bir gün, yaşlı bir kadın dükkana geldi ve Elif\'i gördü. Çatlağı fark etmesine rağmen, onu satın aldı. Eve götürdü ve onu en sevdiği bardak yaptı. Her sabah çayını Elif\'ten içer, çatlağın varlığını bir kusur olarak değil, bir benzersizlik işareti olarak görürdü. Kadın, Elif\'in kusurlu olmasına rağmen hala güzel ve kullanışlı olduğunu anlıyordu. Tıpkı biz insanlar gibi. Hepimizin kusurlarımız var, ama bu bizi daha az değerli yapmaz. Aslında, kusurlarımız bizi benzersiz kılan ve hikayemizi anlatan şeydir.  Elif\'in hikayesi, kadına kendi kusurlarını kabul etmeyi ve onlarla barış içinde yaşamayı öğretti. Bu da onu daha mutlu ve özgüvenli bir insan yaptı.', 1, '2024-12-05', '2024-11-19 12:27:44'),
(23, 'en', 'The Cracked Mug', 'Eliza, a handmade ceramic mug, was flawed. A thin crack ran down its side.  Not perfect like the others, she sat at the back of the shelf. One day, an elderly woman came into the shop and saw Eliza.  Despite noticing the crack, she bought her.  She took Eliza home and made her her favorite mug. Every morning, she drank her tea from Eliza, seeing the crack not as a flaw, but as a mark of uniqueness.  The woman understood that even though Eliza was imperfect, she was still beautiful and useful. Just like us. We all have our flaws, but that doesn\'t make us any less valuable. In fact, our imperfections are what make us unique and tell our story. Eliza\'s story taught the woman to accept her own imperfections and be at peace with them.  This, in turn, made her a happier and more confident person.', 1, '2024-12-04', '2024-11-19 12:27:44'),
(24, 'ru', 'Треснувшая кружка', 'Элиза, сделанная вручную керамическая кружка, была с изъяном. Тонкая трещина шла по ее боку. Неидеальная, как другие, она стояла на задней полке. Однажды в магазин зашла пожилая женщина и увидела Элизу. Несмотря на трещину, она купила ее. Женщина принесла Элизу домой и сделала ее своей любимой кружкой. Каждое утро она пила из нее чай, видя в трещине не недостаток, а знак уникальности. Женщина понимала, что, несмотря на свою неидеальность, Элиза все еще красива и полезна. Так же, как и мы. У всех нас есть недостатки, но это не делает нас менее ценными. На самом деле, наши несовершенства - это то, что делает нас уникальными и рассказывает нашу историю. История Элизы научила женщину принимать свои собственные недостатки и жить с ними в мире. Это, в свою очередь, сделало ее более счастливым и уверенным в себе человеком.', 0, NULL, '2024-11-19 12:27:44'),
(25, 'zh', '有裂缝的马克杯', '伊莱扎是一个手工制作的陶瓷马克杯，它有一个瑕疵。杯身侧面有一条细细的裂缝。它不像其他杯子那样完美，所以一直被放在架子的后面。有一天，一位老妇人来到商店，看到了伊莱扎。尽管注意到了裂缝，她还是买下了它。老妇人把伊莱扎带回家，把它变成了她最喜欢的杯子。每天早晨，她都用伊莱扎喝茶，她并不把裂缝看作是缺陷，而是把它看作是独一无二的标志。老妇人明白，即使伊莱扎不完美，它仍然美丽而实用。就像我们一样。我们都有自己的缺点，但这并不意味着我们没有价值。事实上，我们的不完美之处正是让我们独一无二，并讲述着我们自己的故事。伊莱扎的故事教会了老妇人接受自己的不完美，并与之和平共处。这反过来又让她变得更加快乐和自信。', 0, NULL, '2024-11-19 12:27:44'),
(26, 'tr_TR', 'Yeniden Doğuş', 'Demir, otuzlu yaşlarının başında, mastürbasyon bağımlılığıyla mücadele ediyordu. Bu alışkanlık, hayatını yavaş yavaş ele geçirmiş, onu gerçek dünyadan ve ilişkilerden uzaklaştırmıştı. Utanç ve suçluluk duyguları içinde boğuluyor, bu döngüden nasıl kurtulacağını bilmiyordu. Bir gün, internette bir destek grubuna rastladı. Başta tereddüt etse de, sonunda katılmaya karar verdi. Grubun samimi ve destekleyici ortamı, Demir\'e yalnız olmadığını hissettirdi. Paylaşılan hikayeler, deneyimler ve başa çıkma mekanizmaları, ona umut verdi. Demir, terapiye de başlamaya karar verdi. Terapistiyle birlikte, bağımlılığının altında yatan nedenleri keşfetmeye başladı: stres, yalnızlık, özgüven eksikliği. Bu farkındalık, Demir\'in iyileşme yolculuğunda önemli bir adımdı. Zamanla, Demir, mastürbasyon yapma isteğini kontrol etmeyi öğrendi. Boş zamanlarını daha yapıcı aktivitelere yöneltti: spor, resim, arkadaşlarıyla vakit geçirmek. Kendine olan güveni arttı, gerçek hayattaki ilişkileri daha anlamlı hale geldi. Demir\'in hikayesi, bağımlılığın üstesinden gelmenin mümkün olduğunu gösteriyor. Önemli olan, destek aramaktan çekinmemek, kendimizi anlamak ve hayatımızda olumlu değişiklikler yapmaya istekli olmak.', 1, '2024-12-03', '2024-11-19 12:28:30'),
(27, 'en', 'Reclaiming Life', 'David, in his early thirties, struggled with compulsive masturbation.  It had become a crutch, a way to escape the pressures of life and the complexities of relationships.  Shame and guilt consumed him, and he felt trapped in a cycle he couldn\'t break. One day, he stumbled upon an online support group. Hesitant at first, he eventually joined. The group\'s open and supportive environment allowed David to realize he wasn\'t alone.  Hearing others share their stories, experiences, and coping mechanisms gave him a glimmer of hope.  He also decided to seek professional help and began therapy.  Working with his therapist, David began to explore the underlying reasons for his addiction: stress, loneliness, and a lack of self-esteem. This self-awareness became a crucial step in his journey towards recovery. Over time, David learned to manage his urges. He filled the void with healthier activities: exercise, painting, and spending quality time with friends. His self-confidence grew, and his real-life relationships became more fulfilling. David\'s story is a testament to the fact that overcoming addiction is possible. It\'s about seeking support, understanding ourselves, and being willing to make positive changes in our lives.', 1, '2024-12-02', '2024-11-19 12:28:30'),
(28, 'ru', 'Возвращение к жизни', 'Давид, мужчина чуть за тридцать, боролся с компульсивной мастурбацией. Она стала для него опорой, способом убежать от жизненных трудностей и сложностей отношений. Стыд и вина поглощали его, он чувствовал себя запертым в порочном круге. Однажды он наткнулся на онлайн-группу поддержки. Поначалу он колебался, но в итоге присоединился. Открытая и поддерживающая атмосфера группы позволила Давиду понять, что он не одинок.  Истории, опыт и методы борьбы других участников вселили в него проблеск надежды. Он также решил обратиться за профессиональной помощью и начал терапию. Работая с терапевтом, Давид начал исследовать глубинные причины своей зависимости: стресс, одиночество и низкая самооценка. Это самосознание стало важным шагом на его пути к выздоровлению. Со временем Давид научился справляться со своими влечениями. Он заполнил пустоту здоровыми занятиями: спортом, рисованием и качественным времяпрепровождением с друзьями. Его уверенность в себе выросла, а его реальные отношения стали более полноценными. История Давида свидетельствует о том, что преодолеть зависимость возможно. Речь идет о поиске поддержки, понимании себя и готовности к позитивным изменениям в своей жизни.', 0, NULL, '2024-11-19 12:28:30'),
(29, 'zh', '重获新生', '三十岁出头的戴维一直与强迫性手淫作斗争。它成了他的拐杖，一种逃避生活压力和复杂人际关系的方式。羞耻和内疚感吞噬着他，他感觉自己被困在一个无法打破的循环中。有一天，他偶然发现了一个在线互助小组。起初他犹豫不决，但最终还是加入了。小组开放和支持的氛围让戴维意识到他并不孤单。听到其他人分享他们的故事、经历和应对机制，让他看到了一丝希望。他还决定寻求专业帮助，并开始了心理治疗。在与治疗师的合作中，戴维开始探索他成瘾的根本原因：压力、孤独和缺乏自尊。这种自我意识成为他康复之路上的关键一步。随着时间的推移，戴维学会了控制自己的冲动。他用更健康的活动填补了空虚：锻炼、绘画以及与朋友共度美好时光。他的自信心增强了，他现实生活中的关系也变得更加充实。戴维的故事证明了克服成瘾是可能的。关键在于寻求支持，了解自己，并愿意在生活中做出积极的改变。', 1, '2024-11-22', '2024-11-19 12:28:30'),
(30, 'tr_TR', 'Ömer\'in Uyanışı', 'Ömer, mastürbasyon bağımlılığıyla mücadele eden genç bir adamdı. Bu alışkanlık, hayatının diğer alanlarını gölgelemeye başlamıştı. İlişkilerinde samimiyetten kaçınıyor, işine odaklanmakta zorlanıyor ve genel olarak mutsuz hissediyordu. Bir gün, internette rastladığı bir destek grubunun ilanı dikkatini çekti. Tereddüt etse de gruba katılmaya karar verdi.  Gruptaki diğer insanlarla paylaştıkça, yalnız olmadığını anladı.  Herkesin farklı hikayeleri vardı ama ortak bir noktaları vardı:  Kontrolü yeniden ele alma isteği.  Ömer, grup terapisi ve bireysel danışmanlık sayesinde, bağımlılığının altında yatan duygusal sorunlarla yüzleşmeye başladı.  Özsaygısını yeniden inşa etmek, stresle başa çıkmak için sağlıklı yöntemler geliştirmek ve gerçek hayatta yakınlık kurmak için çaba gösterdi.  Bu kolay bir yol değildi.  Bazen tökezledi, eski alışkanlıklarına geri döndü.  Ama pes etmedi.  Her düşüşten ders çıkararak ayağa kalktı ve yoluna devam etti.  Zamanla, Ömer mastürbasyon üzerindeki kontrolünü yeniden kazandı.  Hayatı daha dengeli ve anlamlı hale geldi.  Artık enerjisini ve zamanını hobilerine, arkadaşlarına ve yeni keşfettiği tutkularına ayırıyordu.  Ömer\'in hikayesi, değişimin mümkün olduğunu gösteriyor.  Umut, her zaman vardır.', 0, NULL, '2024-11-22 13:57:07'),
(31, 'en', 'Ömer\'s Awakening', 'Ömer was a young man struggling with compulsive masturbation.  It had begun to overshadow other aspects of his life. He avoided intimacy in relationships, struggled to focus at work, and felt generally unhappy. One day, he stumbled upon an online advertisement for a support group. Hesitant at first, he decided to attend. Sharing with others in the group, Ömer realized he wasn\'t alone. Everyone had different stories, but they shared a common desire: to regain control. Through group therapy and individual counseling, Ömer began to address the underlying emotional issues fueling his addiction. He worked on rebuilding his self-esteem, developing healthy coping mechanisms for stress, and pursuing real-life connections.  It wasn\'t an easy journey. He stumbled at times, falling back into old habits. But he didn\'t give up.  He learned from each setback, picked himself up, and continued moving forward.  Over time, Ömer regained control over his masturbation. His life became more balanced and fulfilling. He now devoted his energy and time to his hobbies, friends, and newfound passions. Ömer\'s story is a testament to the possibility of change. Hope is always there.', 1, '2024-12-01', '2024-11-22 13:57:07'),
(32, 'ru', 'Пробуждение Омера', 'Омер был молодым человеком, борющимся с компульсивной мастурбацией. Эта привычка начала омрачать другие аспекты его жизни. Он избегал близости в отношениях, с трудом концентрировался на работе и в целом чувствовал себя несчастным. Однажды он наткнулся на онлайн-объявление о группе поддержки. Поначалу он колебался, но все же решил посетить ее. Делясь своим опытом с другими участниками группы, Омер понял, что он не одинок. У каждого была своя история, но всех объединяло одно общее желание: вернуть контроль над собой. Благодаря групповой терапии и индивидуальному консультированию Омер начал разбираться с основными эмоциональными проблемами, которые подпитывали его зависимость. Он работал над восстановлением самооценки, развитием здоровых механизмов преодоления стресса и поиском настоящих отношений. Это был нелегкий путь. Временами он спотыкался, возвращаясь к старым привычкам. Но он не сдавался. Он учился на каждой неудаче, поднимался и продолжал двигаться вперед. Со временем Омер вернул себе контроль над мастурбацией. Его жизнь стала более сбалансированной и наполненной. Теперь он посвящал свою энергию и время своим хобби, друзьям и новым увлечениям. История Омера — свидетельство того, что перемены возможны. Надежда всегда есть.', 1, '2024-12-03', '2024-11-22 13:57:07'),
(33, 'zh', '奥梅尔的觉醒', '奥梅尔是一位与强迫性手淫作斗争的年轻人。这个习惯已经开始影响他生活的其他方面。他在人际关系中逃避亲密，难以集中精力工作，并且总体上感到不快乐。有一天，他偶然发现了一个在线支持小组的广告。起初他有些犹豫，但最终决定参加。在小组中与其他人分享后，奥梅尔意识到他并不孤单。每个人都有不同的故事，但他们都有一个共同的愿望：重新掌控自己。通过小组治疗和个人咨询，奥梅尔开始解决导致他成瘾的潜在情绪问题。他努力重建自尊，培养健康的压力应对机制，并追求现实生活中的联系。这不是一段轻松的旅程。他有时会跌倒，回到旧习惯。但他没有放弃。他从每一次挫折中吸取教训，重新站起来，继续前进。随着时间的推移，奥梅尔重新控制了自己的手淫行为。他的生活变得更加平衡和充实。他现在将自己的精力和时间投入到爱好、朋友和新发现的热情中。奥梅尔的故事证明了改变的可能性。希望永远存在。', 1, '2024-12-02', '2024-11-22 13:57:07');
